import React from 'react';
import HeaderContainer from '../containers/common/HeaerContainer';
import mainImg from '../images/main.png';

const PostPage = () => {
  return (
    <>
      <HeaderContainer />
      <img src={mainImg} alt="main" width="1200" height="800" />
      메인
    </>
  );
};

export default PostPage;
